import React from "react";
import "./contactform.css";
const ContactForm=()=>{
    return(
        <div className="formbox">
        <form className="Contactform" action="#" method="POST">
<input type="text" placeholder="Enter your name" name="username" autocomplete="off" required/>
<input type="number" placeholder="Enter your number"/>
<input type="gmail" placeholder="Enter your gmail"/>
<textarea type="text" placeholder="Type Message..?"></textarea>
<button type="submit" >submit</button>
        </form></div>
    );
}
export default ContactForm;
